                    </div>
                    <div className="message">
                        <input type="text" name='search' id='search'
                         placeholder='search and add friend'
                        />
                    </div>
                    <style jsx> {`
                          .search {
                              width:100%;
                              height:6vh;
                              margin:0 auto;
                              background:white;
                              border-radius:12px;
                              overflow:hidden;
                              display:flex;
                          }
                          .message {
                              height:100%;
                          }
                          .message input {
                              height:100%;
                              border:none;
                              outline:none;
                              font-size:2vh;
                          }
                          .button {
                              display:flex;
                              align-items:center;
                          }
                          .button svg {
                              height:16px;
                          }
                        `}
                    </style>
         </div>        
    )
}

export default SidebarSearch
